import MatchCard from "./MatchCard";

const MatchContainer = ({ matchData }) => {
  const mapMatches = matchData.map((match) => {
    return (
      <MatchCard
        key={match.id}
        id={match.id}
        date={match.date}
        players={match.players}
      />
    );
  });

  return <div>{mapMatches}</div>;
};

export default MatchContainer;
